64;border-color:#739334;text-shadow:rgba(255, 255, 255, 0.5) 0 1px 0}\r\n.gamification2-tip-infobox .gamification2-tip-infobox-content .gamification2-tip-infobox-content-controls a.button:hover{color:#f8f8f8;background:#5f5f5f;border-color:#2c2c2c;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}\r\n.gamification2-tip-infobox .gamification2-tip-infobox-content .gamification2-tip-infobox-content-controls a.button:active{color:white;background:#2c2c2c;border-color:black;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}\r\n.gamification2-tip-infobox a.infobox-close{display:inline-block;width:14px;height:14px;position:absolute;top:20px;right:20px;text-indent:-9999px;background:url("https://gamification.prestashop.com/images/interface/gamification-infobox-close.png") no-repeat}\r\n</style>\r\n<div id="advice-16">\r\n<div class="gamification2-tip">\r\n	<div class="gamification2-tip-title">Astuce</div>\r\n	<span class="gamification2-tip-cta">\r\n<a class="gamification2_fancybox" href="#advice_content_142">Lire</a><a class="gamification_close" style="display:none"  id="14" href="#advice_content_14">close</a></span>\r\n	<div class="gamification2-tip-description-container">\r\n		<span class="gamification2-tip-description">\r\n			Simplifiez vos envois de colis et gagnez du temps chaque jour !\r\n		</span>\r\n	</div>\r\n	<div class="hide">\r\n		<div id="advice_content_142" class="gamification2-tip-infobox">\r\n			<div class="gamification2-tip-infobox-title">\r\n				<span class="gamification2-tip-infobox-title-prefix">Astuce</span>\r\n				Expeditor Inet\r\n			</div>\r\n			<div class="gamification2-tip-infobox-content">\r\n				<div class="gamification2-tip-infobox-content-image">\r\n					<img src="https://gamification.prestashop.com/api/getAdviceImg/14.png" alt="logo">\r\n				</div>\r\n				<div class="gamification2-tip-infobox-content-description">\r\n					<p>Le module PrestaShop Expeditor Inet (Expinet) vous permet de connecter votre boutique au logiciel Expeditor Inet, nécessaire à l\'envoi de vos colis par La Poste. Pour chaque commande, vous gagnez ainsi un temps précieux en exportant directement vos commandes PrestaShop dans le logiciel.</p>\r\n					<div class="gamification2-tip-infobox-content-controls right">\r\n						<a href="javascript:$.fancybox.close();" class="button">fermer</a>\r\n						<a href="https://gamification.prestashop.com/get_advice_link.php?id_advice=14&url=http%3A%2F%2Faddons.prestashop.com%2Ffr%2Ftransport-logistique-livraison-modules-prestashop%2F35-expeditor-inet.html" class="button success">en savoir plus</a>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n</div>\r\n<script>\r\n	$(document).ready( function () {\r\n		$(\'.gamification2_fancybox\').fancybox();\r\n		$(\'.gamification2_fancybox\').bind(\'click\', function () {\r\n			id_advice = 14;			\r\n			$(\'.gamification2-tip-infobox\').after(\'<img style="display:none" src="https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png" />\');\r\n			\r\n		});\r\n	});\r\n</script></div>'),
