 .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:hover{color:#f8f8f8;background:#5f5f5f;border-color:#2c2c2c;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:active{color:white;background:#2c2c2c;border-color:black;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox a.infobox-close{display:inline-block;width:14px;height:14px;position:absolute;top:20px;right:20px;text-indent:-9999px;background:url("https://gamification.prestashop.com/images/interface/gamification-infobox-close.png") no-repeat}\n</style>\n<hr class="clear"/>\n<div id="advice-16">\n<div class="gamification-tip">\n	<div class="gamification-tip-title">Astuce</div>\n	<span class="gamification-tip-cta"><a class="gamification_fancybox"  id="376" href="#advice_content_376">Lire</a><a class="gamification_close" style="display:none"  id="376" href="#advice_content_376">Fermer</a></span>\n\n	<div class="gamification-tip-description-container">\n		<span class="gamification-tip-description">\n			Saviez-vous qu’1/3 des acheteurs en ligne européens ont fait un achat en Europe ? Lancez-vous à l’international !		</span>\n	</div>\n	<div class="hide">\n		<div id="advice_content_376" class="gamification-tip-infobox">\n			<div class="gamification-tip-infobox-title">\n				<span class="gamification-tip-infobox-title-prefix">Astuce</span>\n				Paypal			</div>\n			<div class="gamification-tip-infobox-content">\n				<div class="gamification-tip-infobox-content-image">\n					<img src="https://gamification.prestashop.com/api/getAdviceImg/376.png" alt="logo" style="max-width: 85%">\n				</div>\n				<div class="gamification-tip-infobox-content-description">\n					<p><span style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;">33 % des acheteurs PayPal en ligne en France n&#039;auraient pas acheté sur un site étranger si PayPal n&#039;avait pas été disponible.*</span><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><span style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;">Leurs raisons sont claires.</span><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><span style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;">PayPal rend votre site fiable aux yeux des clients qui achètent depuis d&#039;autres pays. Avec PayPal, ces potentiels clients, présents sur environ 193 marchés au total, peuvent vous payer dans 26 devises.</span><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><span style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;">PayPal peut vous aider dans votre stratégie commerciale à l&#039;international. Les utilisateurs PayPal du monde entier reconnaissent déjà que c&#039;est plus sécurisé, ils apprécient ainsi faire leur achats en toute confiance que ce soit sur leur ordinateur, sur tablette ou sur mobile. De plus, leurs achats peuvent être couverts par la Protection des Achats**. </span><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><span style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;">* Q4 2013 EUROPEAN SALES LIFT REPORT, PayPal, FR</span><br style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;" /><span style="font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;">** https://www.paypal.com/fr/webapps/mpp/paypal-safety-and-security</span></p>					<div class="gamification-tip-infobox-content-controls right">\n						<a href="javascript:$.fancybox.close();" class="button">Annuler</a>\n						<a href="{link}AdminModules{/link}&install=paypal&module_name=paypal" class="button success">Découvrir le module</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 376;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style="display:none" src="https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png" />\');\n			\n		});\n	});\n</script></div>'),
