(272, 1, '<div id="wrap_id_advice_518" >\n		<section id="9_paypal" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Conseil du jour</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-paypal.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/518.png"/>\n				<p><b>Mettez vos moyens de paiement en avant</b></p>\n				<p>Vos clients doivent savoir qu\'ils peuvent utiliser le moyen de paiement qui leur convient dès la home page.<p align="center"><img src="https://api.prestashop.com/partner/tipsoftheday/img/paypal-advise-picto1.png" style="max-width: 100%; padding: 5px 0px 5px 0px;"></p></p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=518&url=http%3A%2F%2Faddons.prestashop.com%2Ffr%2Fmodules-paiement-prestashop%2F1748-paypal.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dpaypal">Envie d\'en savoir plus ?</a>\n				</span>\n			</div>\n		</section>\n		<section id="10_paypal" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Conseil du jour</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-paypal.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/518.png"/>\n				<p><b>Proposez un maximum de moyens de paiement</b></p>\n				<p>Plus vous proposez de moyens de paiement, plus vous faites de ventes. Avec PayPal, proposez 7 moyens de paiement en installant un seul module.<p align="center"><img src="https://api.prestashop.com/partner/tipsoftheday/img/paypal-advise-picto1.png" style="max-width: 100%; padding: 5px 0px 5px 0px;"></p></p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=518&url=http%3A%2F%2Faddons.prestashop.com%2Ffr%2Fmodules-paiement-prestashop%2F1748-paypal.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dpaypal">Envie d\'en savoir plus ?</a>\n				</span>\n			</div>\n		</section>\n		<section id="2_paypal" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Conseil du jour</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-paypal.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/518.png"/>\n				<p><b>Suivez l\'évolution de votre activité en direct</b></p>\n				<p>PayPal vous envoie une notification par email pour chaque transaction réalisée sur votre site.</p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=518&url=http%3A%2F%2Faddons.prestashop.com%2Ffr%2Fmodules-paiement-prestashop%2F1748-paypal.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dpaypal">Envie d\'en savoir plus ?</a>\n				</span>\n			</div>\n		</section>\n		<section id="3_paypal" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Conseil du jour</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-paypal.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getA