(274, 1, '<div id="wrap_id_advice_522" >\n		<section id="0_socolissimo" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Conseil du jour</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-socolissimo.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/522.png"/>\n				<p><b>Rassurez vos clients</b></p>\n				<p>Lors d\'une première expérience client, la mise en avant d\'une marque de livraison reconnue est un gage de qualité et de confiance.</p></p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification.prestashop.com/get_advice_link.php?id_advice=522&url=http%3A%2F%2Faddons.prestashop.com%2Ffr%2Ftransport-logistique-livraison-modules-prestashop%2F1745-so-colissimo.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dsocolissimo">Envie d\'en savoir plus ?</a>\n				</span>\n			</div>\n		</section>\n		<section id="1_socolissimo" class="panel " style="display:none">\n			<header class="panel-heading">\n				<span class="icon-lightbulb"></span> Conseil du jour</header>\n			<div class="panel-body" style="padding:0">\n				<img class="img-responsive" src="https://api.prestashop.com/partner/tipsoftheday/img/logo-socolissimo.png" style="float:right; margin-left: 5px;">\n				<img src="https://gamification.prestashop.com/api/getAdviceImg/522.png"/>\n				<p><b>Importance de la livraison</b></p>\n				<p>66% des e-acheteurs considèrent que les conditions de livraison constituent un élément déterminant dans le choix du site marchand.<br /><br/ ><small>Baromètre FEVAD- Médiamétrie/NetRatings, juin 2007</small></p></p>\n				<span class="text-right" style="float:right">\n					<a class="btn btn-default" target="_blank" href="https://gamification