pte SendinBlue</p>\r\n<p>- Créer de magnifiques emails sans connaissance HTML</p>\r\n<p>- Choisir vos destinataires, grâce à 1 outil de segmentation puissant</p>\r\n<p>- Piloter efficacement vos emails transactionnels (confirmation de commande, expédition de colis …)</p>\r\n<p>- Optimiser la délivrabilité de vos emails</p>\r\n<p>- Suivre vos résultats</p>\r\n<p> </p>					<div class="gamification-tip-infobox-content-controls right">\n						<a href="javascript:$.fancybox.close();" class="button">Annuler</a>\n						<a href="{link}AdminModules{/link}&install=sendinblue&module_name=sendinblue" class="button success">Découvrir le module</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 532;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style="display:none" src="https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png" />\');\n			\n		});\n	});\n</script></div>'),
