 .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:hover{color:#f8f8f8;background:#5f5f5f;border-color:#2c2c2c;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:active{color:white;background:#2c2c2c;border-color:black;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox a.infobox-close{display:inline-block;width:14px;height:14px;position:absolute;top:20px;right:20px;text-indent:-9999px;background:url("https://gamification.prestashop.com/images/interface/gamification-infobox-close.png") no-repeat}\n</style>\n<hr class="clear"/>\n<div id="advice-16">\n<div class="gamification-tip">\n	<div class="gamification-tip-title">Astuce</div>\n	<span class="gamification-tip-cta"><a class="gamification_fancybox"  id="540" href="#advice_content_540">Lire</a><a class="gamification_close" style="display:none"  id="540" href="#advice_content_540">Fermer</a></span>\n\n	<div class="gamification-tip-description-container">\n		<span class="gamification-tip-description">\n			Proposer des recommandations personnalisées à vos clients peut accroître votre taux de conversion de 65 %		</span>\n	</div>\n	<div class="hide">\n		<div id="advice_content_540" class="gamification-tip-infobox">\n			<div class="gamification-tip-infobox-title">\n				<span class="gamification-tip-infobox-title-prefix">Astuce</span>\n				Nosto - Personnalisation pour PrestaShop			</div>\n			<div class="gamification-tip-infobox-content">\n				<div class="gamification-tip-infobox-content-image">\n					<img src="https://gamification.prestashop.com/api/getAdviceImg/540.png" alt="logo" style="max-width: 85%">\n				</div>\n				<div class="gamification-tip-infobox-content-description">\n					<p>Saviez-vous que la personnalisation est l&#039;un des moyens les plus efficaces pour augmenter les ventes en ligne en tirant parti de la conversion ? Grâce à la personnalisation de votre boutique en ligne, chaque client est ciblé de façon individuelle avec des articles qu&#039;il est le plus enclin à acheter à chaque étape du processus d&#039;achat : augmentez le montant moyen de commande de 25 % et votre taux de conversion de 65 % !</p>\r\n<p>Grâce à Nosto, vous pouvez :</p>\r\n<ul>\r\n<li>Augmenter le montant moyen de commande grâce à des recommandations croisées et incitatives</li>\r\n<li>Encourager le taux de conversion grâce à des recommandations de produits pertinentes</li>\r\n<li>Améliorer la rétention grâce à des recommandations personnalisées</li>\r\n<li>En savoir plus sur vos clients grâce à un tableau de bord en temps réel</li>\r\n<li>Réduire le taux de rebond grâce à des listes de produits populaires</li>\r\n<li>Etre opérationnel en moins de 2 minutes, sans risques, en vous appuyant sur un modèle de tarification « pas de vente/pas de facture » et aucune durée de contrat minimum</li>\r\n</ul>					<div class="gamification-tip-infobox-content-controls right">\n						<a href="javascript:$.fancybox.close();" class="button">Fermer</a>\n						<a href="{link}AdminModules{/link}&install=nostotagging&module_name=nostotagging" class="button success">En savoir plus</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 540;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style="display:none" src="https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png" />\');\n			\n		});\n	});\n</script></div>');
