 .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:hover{color:#f8f8f8;background:#5f5f5f;border-color:#2c2c2c;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox .gamification-tip-infobox-content .gamification-tip-infobox-content-controls a.button:active{color:white;background:#2c2c2c;border-color:black;text-shadow:rgba(0, 0, 0, 0.5) 0 1px 0}.gamification-tip-infobox a.infobox-close{display:inline-block;width:14px;height:14px;position:absolute;top:20px;right:20px;text-indent:-9999px;background:url("https://gamification.prestashop.com/images/interface/gamification-infobox-close.png") no-repeat}\n</style>\n<hr class="clear"/>\n<div id="advice-16">\n<div class="gamification-tip">\n	<div class="gamification-tip-title">Astuce</div>\n	<span class="gamification-tip-cta"><a class="gamification_fancybox"  id="588" href="#advice_content_588">Lire</a><a class="gamification_close" style="display:none"  id="588" href="#advice_content_588">Fermer</a></span>\n\n	<div class="gamification-tip-description-container">\n		<span class="gamification-tip-description">\n			Votre boutique est unique : votre nom de domaine doit l&#039;être aussi ! Profitez de -30% sur l’achat d’un nom de domaine personnalisé.		</span>\n	</div>\n	<div class="hide">\n		<div id="advice_content_588" class="gamification-tip-infobox">\n			<div class="gamification-tip-infobox-title">\n				<span class="gamification-tip-infobox-title-prefix">Astuce</span>\n				Choisir son nom de domaine			</div>\n			<div class="gamification-tip-infobox-content">\n				<div class="gamification-tip-infobox-content-image">\n					<img src="https://gamification.prestashop.com/api/getAdviceImg/588.png" alt="logo" style="max-width: 85%">\n				</div>\n				<div class="gamification-tip-infobox-content-description">\n					<p><span style="font-size: 8.5pt; font-family: Verdana, sans-serif;">Votre nom de domaine est l&#039;équivalent d&#039;une enseigne pour votre boutique en ligne. C&#039;est le tout premier mot-clé qui la représentera sur la toile.</span></p>\r\n<p><span style="font-size: 8.5pt; font-family: Verdana, sans-serif;">Votre boutique sera mieux référencée et donc plus visible pour vos clients potentiels si votre nom de domaine est en rapport avec vos produits. </span></p>\r\n<p><span style="font-size: 8.5pt; font-family: Verdana, sans-serif;">Un nom de domaine pertinent sera plus rapidement mémorisable, ainsi vos clients vous retrouverons plus facilement. Même après une seule visite.</span></p>\r\n<p><span style="font-size: 8.5pt; font-family: Verdana, sans-serif;">PrestaShop vous permet, en quelques clics, de réserver votre nom de domaine et d’associer votre boutique à votre marque. </span></p>\r\n<p> </p>\r\n<p><span style="font-size: 8.5pt; font-family: Verdana, sans-serif;">Profitez dès maintenant de <strong>30% de réduction</strong> immédiate sur l&#039;achat de votre nom de domaine grâce à ce code: </span><span style="font-size: 10pt;"><strong><span style="color: #222222; font-family: Calibri, sans-serif;">DN30BO</span></strong></span></p>					<div class="gamification-tip-infobox-content-controls right">\n						<a href="javascript:$.fancybox.close();" class="button">Fermer</a>\n						<a href="https://www.prestashop.com/cloud/fr/my-stores" class="button success">Acheter mon nom de domaine</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 588;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style="display:none" src="https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png" />\');\n			\n		});\n	});\n</script></div>'),
